import React from "react";

import classes from "./Cart.module.css";

const Cart = () => {
  return (
    <div>
      <div></div>
      <div className={classes.total}>
        <span>Total Amount</span>
        <span>50</span>
      </div>
      <div className={classes.actions}>
        <button className={classes["button--alt"]}>Close</button>
        <button>Order</button>
      </div>
    </div>
  );
};

export default Cart;
